import { usestate } from "react";

const Home = () => {
  // let name = "mario";
  const [name, setName] = usestate("mario");

  const handleclick = () => {
    setName("luigi");
  };

  return (
    <div className="Home">
      <h1> Homepage</h1>
      <p>{name}</p>
      <button onClick={handleclick}> click me</button>
    </div>
  );
};

export default Home;
